selector_to_html = {"a[href=\"#security\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Security<a class=\"headerlink\" href=\"#security\" title=\"Link to this heading\">#</a></h1><p>Microsoft takes the security of our software products and services seriously, which includes all source code repositories managed through our GitHub organizations, which include <a class=\"tippyAnchor reference external\" href=\"https://github.com/Microsoft\">Microsoft</a>, <a class=\"tippyAnchor reference external\" href=\"https://github.com/Azure\">Azure</a>, <a class=\"tippyAnchor reference external\" href=\"https://github.com/dotnet\">DotNet</a>, <a class=\"tippyAnchor reference external\" href=\"https://github.com/aspnet\">AspNet</a> and <a class=\"tippyAnchor reference external\" href=\"https://github.com/xamarin\">Xamarin</a>.</p><p>If you believe you have found a security vulnerability in any Microsoft-owned repository that meets <a class=\"tippyAnchor reference external\" href=\"https://aka.ms/security.md/definition\">Microsoft\u2019s definition of a security vulnerability</a>, please report it to us as described below.</p>", "a[href=\"#reporting-security-issues\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Reporting Security Issues<a class=\"headerlink\" href=\"#reporting-security-issues\" title=\"Link to this heading\">#</a></h1><p><strong>Please do not report security vulnerabilities through public GitHub issues.</strong></p><p>Instead, please report them to the Microsoft Security Response Center (MSRC) at <a class=\"tippyAnchor reference external\" href=\"https://aka.ms/security.md/msrc/create-report\">https://msrc.microsoft.com/create-report</a>.</p>", "a[href=\"#policy\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Policy<a class=\"headerlink\" href=\"#policy\" title=\"Link to this heading\">#</a></h1><p>Microsoft follows the principle of <a class=\"tippyAnchor reference external\" href=\"https://aka.ms/security.md/cvd\">Coordinated Vulnerability Disclosure</a>.</p>", "a[href=\"#preferred-languages\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Preferred Languages<a class=\"headerlink\" href=\"#preferred-languages\" title=\"Link to this heading\">#</a></h1><p>We prefer all communications to be in English.</p>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
